function StartScreen({ quizNum, dispatch }) {
  return (
    <div className="start">
      <h2>Welcome to React Quiz</h2>
      <h3>{quizNum} Questions to test your React mastery</h3>
      <button
        className="btn btn-ui"
        onClick={() => dispatch({ type: "acrive" })}
      >
        Let's Start
      </button>
    </div>
  );
}

export default StartScreen;
